Creating a direct equivalent of this class in Swift for iOS would not be possible because the Android and iOS platforms have different UI frameworks and APIs. However, I can provide a Swift class that achieves a similar result using `CALayer` and `UIView`.

Here's a Swift class that creates a stack of images with a similar layout as the Android class:

```swift
import UIKit

class StackedImages: UIView {
    private var iconScale: CGFloat = 0.7
    private var shouldPlaceIcons = true
    private var images: [UIImage]

    init(images: [UIImage]) {
        self.images = images
        super.init(frame: .zero)
        setupLayers()
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        if shouldPlaceIcons {
            placeIcons()
        } else {
            shouldPlaceIcons = true
        }
    }

    private func setupLayers() {
        for image in images {
            let imageLayer = CALayer()
            imageLayer.contents = image.cgImage
            layer.addSublayer(imageLayer)
        }
    }

    private func placeIcons() {
        shouldPlaceIcons = false
        let newWidth = bounds.width
        let iconsSize = floor(newWidth * iconScale)
        let iconsInset = (newWidth - iconsSize) - 1

        for (index, layer) in layer.sublayers!.enumerated() {
            layer.bounds = CGRect(x: 0, y: 0, width: iconsSize, height: iconsSize)
            layer.position = CGPoint(x: bounds.midX, y: bounds.midY)
            switch index {
            case 1:
                layer.frame = CGRect(x: 0, y: iconsInset, width: iconsSize, height: iconsSize)
            case 0:
                layer.frame = CGRect(x: iconsInset, y: 0, width: iconsSize, height: iconsSize)
            default:
                break
            }
        }
    }
}
```

